Recall from the first example that we defined a Person struct with a name and an age attribute, in a similar way to the Python example. We can instantiate a vector of Person objects and iterate over them using enumerate. What is a vector? Like many other languages, Rust provides arrays, but arrays in Rust are fixed-size and allocated on the stack. Vectors are dynamic arrays that are allocated on the heap, and can grow and shrink as needed, similar to Python lists. For most purposes, vectors in Rust perform the same function as Python lists. Unlike a Python list, a vector in Rust can only contain objects of the same type, in this case, Person. fn run2() { let persons = vec![Person::new("James", 33), Person::new("Salima", 31)]; for (i, p) in persons.iter().enumerate() { println!("Person {}: {}", i, p) }
} The vec! macro is syntactic sugar for Vec::new(), which creates a new vector of Person objects. Additionally, the iter method returns an iterator over the vector, which is required before we can call the enumerate method on it. Running the above function via main.rs gives us the same output as in Python: Person 0: James is 33 years old
Person 1: Salima is 31 years old

